import React, { Fragment } from "react"
import {
    Collapse,
    Navbar,
    NavbarToggler,
    NavbarBrand,
    Nav,
    NavItem,
    NavLink
} from 'reactstrap';

const Button = styled.button`
  cursor: pointer;
  font-weight: 500;
  background-color: transparent;
  color: #69302c;
  border: 2px solid #69302c;
  border-radius: .1em;
  padding: .5em 1.25em;
  font-size: 19px;
  &:hover{
    background-color: #69302c;
    color: #fff;
  }
`
const Link = styled.a`
  cursor: pointer;
  font-size: 19px;
`

const Logo = styled.img`
  height: 60px;
`
export default class NavBar extends React.Component {
    render() {
        return (
            <Navbar expand='md' className='sticky-top' light>
            <Container>
              <NavBrand href='/'>
                <Logo src='/static/images/Asset_10.svg' />
              </NavBrand>
              <Fragment>
                  <Nav className='mr-auto ml-auto' navbar>
                    <NavItem>
                      <Link className='px-3' to='what' smooth >
                      คืออะไร
                      </Link>
                    </NavItem>
                    <NavItem>
                      <Link className='px-3' to='who' smooth >
                    ใครมาพูด
                      </Link>
                    </NavItem>
                    <NavItem>
                      <Link className='px-3' to='where' smooth>
                    จัดที่ไหน
                      </Link>
                    </NavItem>
                  </Nav>
                  <Navlink>
                    <Button className='fixed-right'>ส่งหัวข้อสุดชิพ</Button>
                  </Navlink>
                </Fragment>
            </Container>
          </Navbar>
        )
    }
}
